    "environmental-contaminants-in-fish-and-sediments-st-vincent-national-wildlife-refuge-415c5",nt"isopen":
    false,nt"url": null,nt"notes": "Sediments from three ponds on St. Vincent
    Island and ten stations on Pig Island, both in the St. Vincent National Wildlife
    Refuge were analyzed for metals, organochlorine pesticides, polychlorinated biphenyls
    (PCBs), and polycyclic aromatic hydrocarbons. Composite samples for largemouth bass,
    bluegill, and brown bullheads from the three ponds on St. Vincent Island were analyzed
    for metals, organochlorine pesticides and PCBs. Results showed minimal mercury contamination
    in fish. Using an metal:aluminum ratio, arsenic, copper and chromium exceeded expected
    background concentrations in sediments from both locations.",nt"license_title":
